private void checkStaleTerminatedTransaction(MonitoredTransaction transaction, long nowNanos, long terminationTimeoutNanos) {
    transaction.terminationMark().ifPresent(mark -> {
        if (mark.isMarkedAsStale()) {
            return;
        }
        final var nanosSinceTermination = nowNanos - mark.getTimestampNanos();
        if (nanosSinceTermination >= terminationTimeoutNanos) {
            log.warn("Transaction %s has been marked for termination for %d seconds; it may have been leaked. %s", transaction.getIdentifyingDescription(), TimeUnit.NANOSECONDS.toSeconds(nanosSinceTermination), buildTraceOrHelpMessage(transaction.transactionInitialisationTrace()));
            mark.markAsStale();
        }
